import React from 'react'
import ExpenseItem from "./ExpenseItem"
export default function ExpensesList({items}) {

  if(items.length < 0) return <p>No Results found.</p>
  return (
    <ul>
{items.map((expense) => (
      <ExpenseItem key={expense.id} expense={expense} />
    ))}    
    </ul>
  )
}
